import React from 'react';
import { Link } from 'react-router-dom';

const AnimalSidebar = () => {
  return (
    <div className="mb-3">
      <div className="list-group">
        <Link to="#" className="list-group-item list-group-item-action active">
          Animales
        </Link>
        <Link to="#" className="list-group-item list-group-item-action">Perros en adopción</Link>
        <Link to="#" className="list-group-item list-group-item-action">Gatos en adopción</Link>
        <Link to="#" className="list-group-item list-group-item-action">Casos urgentes</Link>
        <Link to="#" className="list-group-item list-group-item-action">Animales adoptados</Link>
      </div>
    </div>
  );
};

export default AnimalSidebar;
